Alien Invaders have attacked Earth, and defeated most of our soldiers.

You are one of the last remaining humans. Are you willing to fight back and show them you're ready to take as many of them with you as possible?

In this survival-type FPS game, the longer you survive against the Alien Invasion of Robox (Robotic Alien Invaders), the better your score will be.

The alpha version features 3 maps with different game-play elements, and the 4th map is under way.

There aren't many survival type FPS's with fun graphics and awesome music like Robox Invasion that are currently available for the computer completely free of charge!

The game captures the essence of fun, it doesn't require you to spend plenty of time building a strong in-game character, and there are no purchases or ads to ruin the awesome experience.

This software is for all gamers around the world, all ages, all genders, are suitable to enjoy this wonderful FPS.

